import styles from "../styles/Footer.module.scss";

function Footer() {
  return (
    <div className={styles.footer}>
      <h3>Contacto</h3>
      <ul>
        <li>@infomaltton@gmail.com</li>
        <li>@maltton</li>
        <li>4706-7343</li>
      </ul>
    </div>
  );
}

export default Footer;
